def draw_score(game, ax, color='blue'):
    x, y = zip(*game['score_history'])
    x = x[:-1]
    y = y[1:]
    ax.set_ylim(0, 1310000)
    ax.step(x, y, color=color, label=game.get('name'))
    ax.patch.set_facecolor('black')


def draw_percents(game, ax, color='red'):
    x, y = zip(*game['score_history'])
    x = x[:-1]
    percents = []
    last_line = 0
    tetrises = 0
    for clears, line in enumerate(x[1:]):
        clears = clears + 1
        diff = line - last_line
        if diff == 4:
            tetrises += 1
        percent = float(tetrises)/float(clears)
        percents.append((line, percent))
        last_line = line
    ax.set_ylim(0, 1.05)
    x, y = zip(*percents)
    ax.plot(x, y, color="red")
    ax.set_ylim(-.025, 1.025)


def clear_axis_lines(ax):
    ax.spines["top"].set_visible(False)
    ax.spines["bottom"].set_visible(False)
    ax.spines["right"].set_visible(False)
    ax.spines["left"].set_visible(False)


def make_combined_spark(game, fn):
    fig, ax1 = plt.subplots()
    fig.set_size_inches(3.5, 2)
    draw_score(game, ax1)

    plt.xticks([])
    plt.yticks([])

    ax2 = ax1.twinx()
    draw_percents(game, ax2)
    plt.xticks([])
    plt.yticks([])
    clear_axis_lines(ax1)
    clear_axis_lines(ax2)

    plt.savefig(fn)


def scale_rgb(*args):
    return tuple(float(x)/255 for x in args)


def hide_axis(fig):
    plt.xticks([])
    plt.yticks([])
    for ax in fig.axes:
        # ax.axis('off')
        ax.margins(0,0)
        ax.xaxis.set_major_locator(plt.NullLocator())
        ax.yaxis.set_major_locator(plt.NullLocator())


def compare_scores(fn, *games, **kwargs):
    fig, ax1 = plt.subplots()
    fig.set_size_inches(7, 4)

    colors = [
        (31, 119, 180),
        (255,127,14),
        (44,160,44),
    ]

    for game in games:
        draw_score(game, ax1, color=scale_rgb(*colors.pop(0)))
    ax1.legend(loc='upper left')
    hide_axis(fig)
    plt.style.use("dark_background")
    plt.savefig(fn , bbox_inches = 'tight', pad_inches = 0)
    if kwargs.get("show"):
        plt.show()


def plot_session(fn, session):

    x1, y1 = zip(*[(int(game.get("lines")), int(game.get("score"))) for game in session if game.get("level") == 18])
    x2, y2 = zip(*[(int(game.get("lines")), int(game.get("score"))) for game in session if game.get("level") == 19])


    plt.clf()
    # plt.pcolor(xedges, yedges, heatmap)
    plt.scatter(x1, y1, c=scale_rgb(31, 119, 180), alpha=.75, linewidths=1, s=10, label="Level 18 start")
    plt.scatter(x2, y2, c=scale_rgb(255,127,14), alpha=.75, linewidths=1, s=10, label="Level 19 start")
    plt.legend(loc='upper left', frameon=True)
    # plt.show()
    plt.savefig(fn)


def plot_games_plotly(*args):
    data = []
    for game in args:
        x, y = zip(*game['score_history'])
        trace = {
          "x": x,
          "y": y,
          "line": {"shape": 'hv'},
          "mode": 'lines',
          "name": game['name'],
          "type": 'scatter'
        }
        data.append(trace)
    layout = go.Layout(
        xaxis={'range': [0, 235]},
        height=500,
        width=750,
    )
    fig = go.Figure(data=data, layout=layout)
    plotly.offline.plot(fig)


